import React from 'react';
import './App.css';
import Player from './Player.js'

export default function PlayerList({ Players }){



    return(
        <div>
            {Players.map(player => {
                return (<div><Player key={player.Position} Player={player} /><button>Next</button></div>)
            })}
        </div>
    )
}


